import React, {useMemo} from 'react';

import { 
    Container,
    Profile,
    Welcome,
    UserName
}  from './styles';

const MainHeader: React.FC = () => {
    return (
        <Container>
            <h1>toogle</h1>
            <Profile>
                <Welcome>Ola, </Welcome>
                <UserName>Rafael Jacomel</UserName>
            </Profile>
        </Container>
    );
}

export default MainHeader;
